import React from 'react';
import { SearchNumContaner } from './CardCar.styled';
import Form from 'react-bootstrap/Form';


export default function App() {
  return (
    <SearchNumContaner>
      <Form.Label htmlFor="inputPassword5" style={{color:"white"}}>Введите номер</Form.Label>
      <Form.Control
        type="text"
        id="inputPassword5"
        aria-describedby="passwordHelpBlock"
      />
      <Form.Text id="passwordHelpBlock" muted>
        Номер дожен соответсвовать регламентам Украины
      </Form.Text>
    </SearchNumContaner>
  );
}
